import { NavLink } from "react-router-dom";
import classes from '../index.css';

const EventPage = () =>{
    return <>
        <h1 className={classes.con}>HEllo Event Page!</h1>
        <ul className={classes.con}>
            <li>
                <NavLink to="/">Home</NavLink>
            </li>
        </ul>
    </>
}

export default EventPage;
